import React from 'react';
import whiteLogo from '../../styles/images/whiteLogo.png';
import { Input, Button } from 'antd';
import { AiOutlineUser, AiFillLock } from 'react-icons/ai'
import 'antd/dist/antd.css'


const style = {
    main: {
        display: 'flex',
        height: '100%',
        width: '100%',
        background: '#ff773b'
    },
    divInfo: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
        height: '100%',
        width: '100%'
    },
    sectionInfo: {
        height: '100%',
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        flexDirection: 'column',
        color: '#ffffff'
    },
    sectionLogin: {
        height: '10%',
        width: '100%',
        display: 'flex',
        justifyContent: 'center'
    },
    input: {
        width: '331px',
        height:'29px',
        marginBottom: '13px'
    }
}

const Login = () => {
    return (
        <main style={style.main}>
            <div style={style.divInfo}>
                <section style={style.sectionLogin}>
                    <img src={whiteLogo} style={{marginTop:'5px'}} alt="CNX Telecom - você sempre conectado!" />
                    <Input style={style.input} prefix={<AiOutlineUser/>}></Input>
                    <Input.Password style={style.input}></Input.Password>
                </section>
                <section style={style.sectionInfo}>
                    <h1 style={{ color: '#fff', fontFamily: 'Lato', fontSize: '25px', fontWeight: 'lighter', WebkitFontSmoothing: 'antialiased' }}>Gerencie o conteúdo que sera mostrado a seus clientes</h1>
                </section>
            </div>
        </main>
    )
}

export default Login
